import styled from 'styled-components';
import SignUpWith from './SignUpWith';
import SignUpNew from './SignUpNew';
import SignUpRegularay from './SignUpRegularay';
import { useEffect } from 'react';

const StyledButton = styled.button`
width:70%;
height:35px;
margin:3px 0px;
font-family:-apple-system, BlinkMacSystemFont, 'Segoe UI', Roboto, Oxygen, Ubuntu, Cantarell, 'Open Sans', 'Helvetica Neue', sans-serif;
font-weight:bold;
border-radius:10px;
border:2px solid black;
cursor: pointer;
background-color:#ffffff;
outline:none;
&:hover{
        background: rgba(255,255,255,.8);
        color: black;
     }
`
const StyledTitle = styled.h1`
font-size:20px;
color:white;
margin:5px 0px;
`
const StyledContainer = styled.div`
    transition:ease 2s;
    border:2px solid white;
    width:500px;
    margin:0 auto;
    display:flex;
    justify-content:center;
    flex-direction:column;
    align-items:center;
    `;
const SignUpPopup = ({showPopup}) => {
    
    useEffect(() => {
        console.log("current state of showPopup is " + showPopup)
    }, [showPopup]);

    return (
        <StyledContainer>
            <StyledTitle>Quick & Dirty</StyledTitle>
            <SignUpWith />
            <StyledTitle>Or</StyledTitle>
            <SignUpRegularay />
        </StyledContainer>


    )
}
export default SignUpPopup;
